import React from 'react';
import {Routes, Route} from 'react-router-dom'
import Loan from './pages/Loan';
import Payment from './pages/Payment';

function App() {
    return (
        <div>
            <Routes>
                <Route path='/' element={<Loan/>} />
                <Route path='/payment' element={<Payment/>}/>
            </Routes>
        </div>
    );
}

export default App;
